import React from "react";
import axios from "axios";
function DashBoard() {
  useEffect =
    (async () => {
      try {
        const res = await axios.get("localhost:5000/api/room/getallrooms");
        console.log(res.data);
        return res.data;
      } catch (err) {
        console.log(err);
      }
    },
    []);

  return (
    <div>
      <h1>Roooms</h1>
    </div>
  );
}

export default DashBoard;
